import React from 'react';
import styles from '../styles/Contact.module.css';

const Contact = () => {
    const contactInfo = [
        {
            icon: 'fas fa-envelope',
            label: 'Email',
            value: 'marcuerodri@gmail.com',
            link: 'mailto:marcuerodri@gmail.com',
            description: 'Feel free to reach out for any inquiries'
        },
        {
            icon: 'fas fa-phone',
            label: 'Phone',
            value: '+34 644 428 895',
            link: 'tel:+34644428895',
            description: 'Available for calls during business hours'
        },
        {
            icon: 'fab fa-linkedin',
            label: 'LinkedIn',
            value: 'marta-cuevas-rodriguez',
            link: 'https://www.linkedin.com/in/marta-cuevas-rodriguez-07564b368',
            description: 'Connect with me professionally'
        },
        {
            icon: 'fab fa-github',
            label: 'GitHub',
            value: 'martacuevasr',
            link: 'https://github.com/martacuevasr',
            description: 'Check out my code and projects'
        }
    ];

    return (
        <div className={styles.contactPage}>
            <div className={styles.container}>
                <div className={styles.contactHeader}>
                    <h1 className={styles.pageTitle}>Get In Touch</h1>
                    <p className={styles.subtitle}>
                        I'm always interested in new opportunities and collaborations. 
                        Let's connect and discuss how we can work together!
                    </p>
                </div>

                <div className={styles.contactGrid}>
                    {contactInfo.map((contact, index) => (
                        <div key={index} className={styles.contactCard}>
                            <div className={styles.contactIcon}>
                                <i className={contact.icon}></i>
                            </div>
                            <div className={styles.contactContent}>
                                <h3 className={styles.contactLabel}>{contact.label}</h3>
                                <a 
                                    href={contact.link}
                                    target={contact.label === 'LinkedIn' || contact.label === 'GitHub' ? '_blank' : '_self'}
                                    rel={contact.label === 'LinkedIn' || contact.label === 'GitHub' ? 'noopener noreferrer' : ''}
                                    className={styles.contactValue}
                                >
                                    {contact.value}
                                </a>
                                <p className={styles.contactDescription}>
                                    {contact.description}
                                </p>
                            </div>
                        </div>
                    ))}
                </div>

                <div className={styles.additionalInfo}>
                    <div className={styles.infoCard}>
                        <h3 className={styles.infoTitle}>About Me</h3>
                        <p className={styles.infoText}>
                            Health Engineer passionate about combining technology with healthcare. 
                            Based in MÃ¡laga, Spain, I'm always excited to discuss new projects 
                            and opportunities in data science and health technology.
                        </p>
                    </div>

                    <div className={styles.infoCard}>
                        <h3 className={styles.infoTitle}>What I'm Looking For</h3>
                        <p className={styles.infoText}>
                            Opportunities in health engineering, data science, machine learning, 
                            and innovative healthcare solutions. Open to collaborations, 
                            full-time positions, and exciting projects.
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Contact;
